import React, { useState, useRef } from 'react';
import emailjs from '@emailjs/browser';
import './Contact.css';

const Contact = () => {
  const form = useRef();
  const [status, setStatus] = useState('');

  const sendEmail = (e) => {
    e.preventDefault();
    setStatus('sending');

    emailjs.sendForm(
      'service_xxxxxxx', // Replace with your EmailJS service ID
      'template_xxxxxxx', // Replace with your EmailJS template ID
      form.current,
      'public_key_xxxxxxx' // Replace with your EmailJS public key
    )
      .then((result) => {
        setStatus('success');
        form.current.reset();
      }, (error) => {
        setStatus('error');
        console.log(error.text);
      });
  };

  return (
    <section className="contact" id="contact">
      <div className="contact-header">
        <h2>Get In Touch</h2>
        <p>Let's work together</p>
      </div>

      <div className="contact-container">
        <div className="contact-info-box">
          <div className="contact-info">
            <div className="info-item">
              <i className="fas fa-phone"></i>
              <div className="info-content">
                <h4>Phone</h4>
                <a href="tel:+918828271782">+91 8828271782</a>
              </div>
            </div>
            <div className="info-item">
              <i className="fas fa-envelope"></i>
              <div className="info-content">
                <h4>Email</h4>
                <a href="mailto:siddhigawade.sbg25@gmail.com">siddhigawade.sbg25@gmail.com</a>
              </div>
            </div>
            <div className="info-item">
              <i className="fas fa-map-marker-alt"></i>
              <div className="info-content">
                <h4>Location</h4>
                <p>Suyah CHS, Sec 21 Nerul,<br />Navi Mumbai - 400706</p>
              </div>
            </div>
          </div>
        </div>

        <div className="contact-form-box">
          <form ref={form} onSubmit={sendEmail}>
            <div className="form-group">
              <input
                type="text"
                name="user_name"
                placeholder="Your Name"
                required
              />
            </div>
            <div className="form-group">
              <input
                type="email"
                name="user_email"
                placeholder="Your Email"
                required
              />
            </div>
            <div className="form-group">
              <input
                type="text"
                name="subject"
                placeholder="Subject"
                required
              />
            </div>
            <div className="form-group">
              <textarea
                name="message"
                placeholder="Your Message"
                required
              ></textarea>
            </div>
            <button type="submit" className="submit-btn">
              {status === 'sending' ? 'Sending...' : 'Send Message'}
            </button>
            {status === 'success' && <p className="success-message">Message sent successfully!</p>}
            {status === 'error' && <p className="error-message">Failed to send message. Please try again.</p>}
          </form>
        </div>
      </div>
    </section>
  );
};

export default Contact;
